import React, {Component} from 'react'


//class based component
/* syntax of class based component 
class LoginComponent extends Component{
    constructor(){

    }
    render(){
        return <div></div>
    }

}
*/
class LoginComponent extends Component{
    constructor(){
        super()
    }
    render(){
        return <div>
            <h1>Login</h1>
            <input type="text"></input>
            </div>
    }
    //render must return one single tag

}
